          </GridListTile>
          <GridListTile key="food.jpeg" cols={1}>
            <img src="food.jpeg" alt="test" />
            <GridListTileBar title="FOOD" subtitle="MUSC" />
          </GridListTile>
          <GridListTile key="food.jpeg" cols={1}>
            <img src="food.jpeg" alt="test" />
            <GridListTileBar title="FOOD" subtitle="MUSC" />
          </GridListTile>
        </GridList>
      </div>
    )
  }
}

export default Events
